DROP DATABASE IF EXISTS seguimiento_proyectos;
-- -- -----------------------------------------------------------------------------------
CREATE DATABASE seguimiento_proyectos DEFAULT CHARACTER SET latin1 COLLATE latin1_bin;
USE seguimiento_proyectos;
-- ------------------------------------------------------
--  DDL for Table TM_USUARIO
-- ------------------------------------------------------
CREATE TABLE TM_USUARIO(
	CODIGO_USUARIO VARCHAR(30) PRIMARY KEY, 
	NOMBRES_USUARIO VARCHAR(150), 
	APELLIDOS_USUARIO VARCHAR(150), 
	NACIMIENTO_USUARIO DATE, 
	PASSWORD_USUARIO VARCHAR(32)
);
-- ------------------------------------------------------
--  DDL for Table TM_PROYECTO
-- ------------------------------------------------------
CREATE TABLE TM_PROYECTO(
	CODIGO_PROYECTO INT(7) PRIMARY KEY,
	NOMBRE_PROYECTO VARCHAR(150), 
	DESCRIPCION_PROYECTO VARCHAR(255), 
	INICIO_PROYECTO DATE, 
	FIN_PROYECTO DATE, 
	RESPONSABLE_PROYECTO VARCHAR(30)
);
-- ------------------------------------------------------
--  DDL for Table TM_TAREA
-- ------------------------------------------------------
CREATE TABLE TM_TAREA(
	CODIGO_TAREA INT(7) PRIMARY KEY,
	NOMBRE_TAREA VARCHAR(150), 
	DESCRIPCION_TAREA VARCHAR(255), 
	CODIGO_PROYECTO INT(7)
);
-- ------------------------------------------------------
--  DDL for Table TM_RESPONSABLE
-- ------------------------------------------------------
CREATE TABLE TM_RESPONSABLE(
	CODIGO_RESPONSABLE INT(7) PRIMARY KEY,
	CODIGO_TAREA INT(7),
	CODIGO_USUARIO VARCHAR(30)
);





-- ------------------------------------------------------
--  Ref Constraints for Table TM_PROYECTO
-- ------------------------------------------------------
ALTER TABLE TM_PROYECTO ADD CONSTRAINT TM_PROYECTO_TM_USUARIO FOREIGN KEY (RESPONSABLE_PROYECTO)
REFERENCES TM_USUARIO (CODIGO_USUARIO)  ON DELETE RESTRICT ON UPDATE RESTRICT;
-- ------------------------------------------------------
--  Ref Constraints for Table TM_RESPONSABLE
-- ------------------------------------------------------
ALTER TABLE TM_RESPONSABLE ADD CONSTRAINT TM_RESPONSABLE_TM_TAREA FOREIGN KEY (CODIGO_TAREA)
REFERENCES TM_TAREA (CODIGO_TAREA)  ON DELETE RESTRICT ON UPDATE RESTRICT;

ALTER TABLE TM_RESPONSABLE ADD CONSTRAINT TM_RESPONSABLE_TM_USUARIO FOREIGN KEY (CODIGO_USUARIO)
REFERENCES TM_USUARIO (CODIGO_USUARIO)  ON DELETE RESTRICT ON UPDATE RESTRICT;
-- ------------------------------------------------------
--  Ref Constraints for Table TM_TAREA
-- ------------------------------------------------------
ALTER TABLE TM_TAREA ADD CONSTRAINT TM_TAREA_TM_PROYECTO FOREIGN KEY (CODIGO_PROYECTO)
REFERENCES TM_PROYECTO (CODIGO_PROYECTO)  ON DELETE RESTRICT ON UPDATE RESTRICT;